import env from 'react-dotenv'
import SongChoice from '../pages/SongChoice'


const Songs = () => {

    const[allSongs, setAllSongs] = useState(null)

    const getAllSongs = async() => {
            try {
            const res = await axios.get(`${env.API_URL}/songs`)
            setAllSongs(res.data.songs)
            console.log(res)
            console.log(res.data.id)
            console.log(res)
            } catch (error) {
                console.log(error)
            }
    }

    useEffect(() => {
        getAllSongs()
    },[])

    return (
        <>
        <h1>Check Out These from the Community!</h1>
        {allSongs && allSongs.map((song, i) =>
            <li><SongChoice
                key={song.id}
                song={song}
                preview="true"
                placeholder={song.title}


                // <Link to={`/songs/${params.id}/lyrics`}>View Lyrics</Link>

                /* <button onClick={() => {
